import React, { useCallback } from "react";
import PropTypes from "prop-types";
import { Input } from "antd";

const PostForm = () => {
  const onSubmit = useCallback(() => {}, []);

  return (
      <Form onFinish={onSubmit}>
        <Input.TextArea  />
      </Form>
  );
};

PostForm.propTypes = {};

export default PostForm;
